# -*- coding: utf-8 -*-

import unittest
import numpy as np
import os
import sys
from interpolation.interpolation import Interpolation
from StringIO import StringIO


class InterpolationTests(unittest.TestCase):

    _interpolation = None

    @classmethod
    def setUpClass(cls):
        cls._interpolation = Interpolation()

    @classmethod
    def tearDownClass(cls):
        cls._interpolation = None

    def test_load_valid_file(self):
        interpolation = Interpolation()
        interpolation.from_file('./testfiles/valid.json')

        self.assertEqual('kriging', interpolation._method)
        self.assertEqual(1.0, interpolation._xMin)
        self.assertEqual(1.2, interpolation._xMax)
        self.assertEqual(2.1, interpolation._yMin)
        self.assertEqual(0.2, interpolation._yMax)
        self.assertEqual(12, interpolation._nX)
        self.assertEqual(13, interpolation._nY)
        self.assertEqual(2, len(interpolation._points))

        points = interpolation._points
        self.assertEqual(1.1, points[0]['x'])
        self.assertEqual(2.2, points[0]['y'])
        self.assertEqual(3.4, points[0]['value'])
        self.assertEqual(4.4, points[1]['x'])
        self.assertEqual(5.5, points[1]['y'])
        self.assertEqual(6.6, points[1]['value'])

    def test_load_invalid_JSON_format(self):
        interpolation = Interpolation()
        interpolation.from_file('./testfiles/invalid.json')
        saved_stdout = sys.stdout
        try:
            out = StringIO()
            sys.stdout = out
            interpolation.render_output()
            output = out.getvalue().strip()
            self.assertEqual('{"error":"Something went wrong with the json decoding"}',
                             output.encode('ascii', 'ignore'))
        finally:
            sys.stdout = saved_stdout

    def test_load_empty_file(self):
        interpolation = Interpolation()
        interpolation.from_file('./testfiles/empty.json')
        saved_stdout = sys.stdout
        try:
            out = StringIO()
            sys.stdout = out
            interpolation.render_output()
            output = out.getvalue().strip()
            self.assertEqual('{"error":"Something went wrong with the json decoding"}',
                             output.encode('ascii', 'ignore'))
        finally:
            sys.stdout = saved_stdout

    def test_idw_with_file(self):
        interpolation = Interpolation()
        interpolation.from_file('./testfiles/valid_idw.json')
        interpolation.calculate()
        self.assertEqual(50, len(interpolation._output))
        self.assertEqual(50, len(interpolation._output[0]))

    def test_kriging(self):
        interpolation = Interpolation()
        interpolation.from_file('./testfiles/valid.json')
        interpolation.calculate()
        self.assertEqual(13, len(interpolation._output))
        self.assertEqual(12, len(interpolation._output[0]))

    def test_mean_with_file(self):
        interpolation = Interpolation()
        interpolation.from_file('./testfiles/valid_mean.json')
        interpolation.calculate()
        self.assertEqual(60, len(interpolation._output))
        self.assertEqual(50, len(interpolation._output[0]))

    def test_mean(self):
        mean = Interpolation.mean(10, 20, np.array([1.2, 1.3, 1.4, 1.6, 1.9]))
        self.assertEqual(20, len(mean))
        self.assertEqual(10, len(mean[1]))
        self.assertEqual(1.48, mean[1][2])

    def test_gaussian(self):
        interpolation = Interpolation()
        interpolation.from_file('./testfiles/valid_gaussian.json')
        interpolation.calculate()
        self.assertEqual(50, len(interpolation._output))
        self.assertEqual(50, len(interpolation._output[0]))

    def test_with_two_points(self):
        interpolation = Interpolation()
        interpolation.from_string(json_input='{"bounding_box":{"x_min":0,"x_max":10,"y_min":0,"y_max":10},"grid_size":{"n_x":10,"n_y":11},"point_values":[{"x":1,"y":5,"value":800},{"x":2,"y":8,"value":3}],"type":"gaussian"}')
        interpolation.calculate()
        self.assertEqual('Exception raised in calculation of method gaussian', interpolation._error_message)

